import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'
import Shops from './components/Shops'
import Nav from './components/Nav'

import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
      <Nav />
        <Switch>
          <Route exact path="/" component={Shops}/>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
